    {
        [TestMethod]
        public void WhirlpoolTestMethod()
        {
            var pluginInstance = TestHelpers.GetPluginInstance("WPHash", "Whirlpool");
            var scenario = new PluginTestScenario(pluginInstance, new[] { "InputData" }, new[] { "HashOutputData" });

            foreach (TestVector vector in testvectors1)
            {
                object[] output = scenario.GetOutputs(new object[] { vector.input.ToByteArray() });
                Assert.AreEqual(vector.output, output[0].ToHex(), "Unexpected value in test #" + vector.n + ".");
            }

            int i = 0;
            foreach (TestVector vector in testvectors2)
            {
                object[] output = scenario.GetOutputs(new object[] { new byte[i++] });
                Assert.AreEqual(vector.output, output[0].ToHex(), "Unexpected value in test #" + vector.n + ".");
            }

            foreach (TestVector vector in testvectors3)
            {
                object[] output = scenario.GetOutputs(new object[] { vector.input.HexToByteArray() });
                Assert.AreEqual(vector.output, output[0].ToHex(), "Unexpected value in test #" + vector.n + ".");
            }
        }

        struct TestVector
        {
            public string input, output;
            public int n;
        }


